import React, { Component } from 'react'

export default class LoginComponent extends Component {
    render() {
        return (
            <div>
                <h1>Login</h1>
                <div>
                    User Name: <input type="text" name="username" />
                    Password: <input type="password" name="password" />
                    <button>Login</button>
                </div>
            </div>
        )
    }
}
